import React, {useState} from "react";
import MainLayout from '../layout/MainLayout.jsx';

const TrainingProgramas = () => {
    return (
        <><MainLayout>
            <div>Training Progs page</div>
        </MainLayout><div>
                <select value={selectedCategory} onChange={handleCategoryChange}>
                    <option value="">Select a category</option>
                    <option value="back">Back</option>
                    <option value="chest">Chest</option>
                    <option value="legs">Legs</option>
                    <option value="arms">Arms</option>
                    <option value="shoulders">Shoulders</option>
                </select>

                {getCategoryLinks()}
            </div></>
    )

    const LinkSelector = () => {
        const [selectedCategory, setSelectedCategory] = useState('');

        const handleCategoryChange = (e) => {
            setSelectedCategory(e.target.value);
        };
   
        const getCategoryLinks = () => {
            switch (selectedCategory) {
                case 'back':
                    return (
                        <div>
                            <a href="back_link_1">Back Link 1</a>
                            <a href="back_link_2">Back Link 2</a>
                            <a href="back_link_3">Back Link 3</a>
                        </div>
                    );
                case 'chest':
                    return (
                        <div>
                            <a href="chest_link_1">Chest Link 1</a>
                            <a href="chest_link_2">Chest Link 2</a>
                            <a href="chest_link_3">Chest Link 3</a>
                        </div>
                    );
                case 'legs':
                    return (
                        <div>
                            <a href="legs_link_1">Legs Link 1</a>
                            <a href="legs_link_2">Legs Link 2</a>
                            <a href="legs_link_3">Legs Link 3</a>
                        </div>
                    );
                case 'arms':
                    return (
                        <div>
                            <a href="arms_link_1">Arms Link 1</a>
                            <a href="arms_link_2">Arms Link 2</a>
                            <a href="arms_link_3">Arms Link 3</a>
                        </div>
                    );
                case 'shoulders':
                    return (
                        <div>
                            <a href="shoulders_link_1">Shoulders Link 1</a>
                            <a href="shoulders_link_2">Shoulders Link 2</a>
                            <a href="shoulders_link_3">Shoulders Link 3</a>
                        </div>
                    );
                default:
                    return null;
            }
        };
    }
};
export default TrainingProgramas;
